import React from "react";
import SearchField from "./searchField";
import Background from "./background.jpg";
import NavBar from "./navbar";

const issue = [
    {
        ServiceDelivery: {
            ResponseTimestamp: "2019-06-11T14:10:16.854311+02:00",
            ProducerRef: "Ent",
            SituationExchangeDelivery: {
                ResponseTimestamp: "2019-06-11T14:10:16.854336+02:00",
                Situations: {
                    PtSituationElement: {
                        CreationTime: "2019-06-06T08:49:56.372+02:00",
                        ParticipantRef: "GOA",
                        SituationNumber: "GOA:SituationNumber:1234",
                        Source: {
                            SourceType: "directReport",
                        },
                        Progress: "open",
                        ValidityPeriod: {
                            StartTime: "2019-06-06T08:48:00+02:00",
                            EndTime: "2019-06-21T23:59:00+02:00",
                        },
                        Severity: "normal",
                        ReportType: "incident",

                    }
                }
            }
        }
    }
];

class Overview extends React.Component {
    constructor(props) {
        super(props);

        this.handleClick = this.handleClick.bind(this);
    }

    handleClick(event) {
        this.props.history.push('/');
    }

    render() {
        return (
            <div>
                <img id="background" src={ Background } alt="" />
                <div className="navBar">
                <NavBar />
                </div>
                <div className="register_box" >
                    <h2 className="text-center text-white">Oversikt</h2>
                    <br></br>
                    <button onClick={this.handleClick} type="submit" className="btn btn-warning btn-lg btn-block">Tilbake</button>
                </div>
            </div>
        );
    }
}

export default Overview;
